import React, { FC, useEffect } from "react";
import { Mod } from "../models/Mod";
import { Modes } from "../models/Modes";

interface DebutProps {
    title: string;
    debuts: string[];
    children?: string;
    mod: Mod;
    clickUp: (mod: Mod) => void; // ожидаем функцию
}


const DebutsMake: FC<DebutProps> = ({title, debuts, children, mod, clickUp}) => {

    return (
        <p className = "debuts">
            <h3>{title}</h3>
            {debuts.map(debut => 
                <p key={1}>
                    <button>{debut}</button>
                </p>
            )}
            <button onClick={() => clickUp(mod)}>{children}</button>
        </p>
    );
};

export default DebutsMake;
